"""Very simple character 4-gram LangID classifier on up to 1634 languages.

See README for details.
"""


from collections import Counter, defaultdict

class FunLangID():
  onegram_langs = "zh zh-Hant yue ja".split()  # bo, dz, th, km were already fine interestingly
  onegram_ignore = {chr(i) for i in range(126)}

  def __init__(self, n_langs=None, top_n=150, include_langs:list=None):
    self._init_lexicon()
    if n_langs is None:
      n_langs = len(self._lexicon)
    assert 0 < top_n <= 150
    assert 1 < n_langs <= len(self._lexicon)

    self.char_n = 4
    self.lex_dict = defaultdict(list)  # map of tokens to langs list

    for i, (lang, toks) in enumerate(self._lexicon):
      if (i > n_langs):
        if not include_langs or lang not in include_langs: continue
      for tok in toks[0:top_n]:
        self.lex_dict[tok].append(lang)

    # converting list to tuple gives a 27% space improvement
    for tok, langs in self.lex_dict.items():
      self.lex_dict[tok] = tuple(langs)
    del self._lexicon


  def _normalize(self, line:str):
    return line.lower().replace('"', "'").replace("/", " ")

  def _char_ngrams(self, line, onegram=False):
    ngrams = Counter()
    if onegram:
     return [ch for ch in line.strip() if not ch in self.onegram_ignore]
    line = f" {line.strip()} "
    cur_ngrams = [line[i:i+self.char_n].strip() for i in range(0, len(line)-self.char_n)]
    return [subtok for subtok in cur_ngrams if len(subtok) > 1]

  def predict_top(self, text):
    pred_score = self.predict(text, 1)
    if not pred_score: return "und"
    pred, score = pred_score[0]
    if not score: return "und"
    return pred

  def predict(self, text, top_n_predictions=5):
    normalized =  self._normalize(text)
    tok_text = self._char_ngrams(normalized)
    tok_text_onegram = self._char_ngrams(normalized, onegram=True)
    if not tok_text: return [("und", 0)]

    possible_langs = [lang for tok in tok_text for lang in  self.lex_dict[tok] ]
    possible_langs += [lang for tok in tok_text_onegram for lang in  self.lex_dict[tok] if lang in self.onegram_langs]
    return  [(lang, ct/len(tok_text)) for  lang, ct in Counter(possible_langs).most_common(top_n_predictions)]


